import React from 'react';
import './style.css'
import firstImg from '../../images/assassins.jpg.jpg'
import secondImg from '../../images/uncharted.jpg'



const MediumArticle = ({ Img, Title, Description }) => {
    return (
        <div className="container">

            <div className="first-article">

                <article className="first-article-first-game">

                    <div>
                        <img className="first-article-thumb" src={Img} alt="Assassins creed news" />

                    </div>

                    <div className="first-article-description">
                        <p className="first-title">{Title} </p>
                        <p className="first-description">{Description} </p>
                    </div>
                </article>

            </div>

        </div>



    );
}

export default MediumArticle;
